import './Results.css';
import Result from '../result/Result';
import React, {useEffect, useState} from "react"
import axios from 'axios';

function Results() {

  const Results = [
      {
        gymName: "Gym 1",
        gymAddress: "123 Main St",
        gymRating: "4.5"
      },
      {
        gymName: "Gym 2",
        gymAddress: "456 Main St",
        gymRating: "4.0"
      },
      {
        gymName: "Gym 3",
        gymAddress: "789 Main St",
        gymRating: "3.5"
      }
    ];

  const listOfGyms = () => {
    fetch('localhost:8080/gyms')
  .then(response => {
    if (!response.ok) {
      throw new Error('Network response was not ok');
    }
    return response.json();
  })
  .then(data => {
    // Work with the data received from the backend
    console.log(data);
  })
  .catch(error => {
    // Handle errors here
    console.error('There was a problem with the request:', error);
  });
  };

  console.log(listOfGyms);

  return (
    <div className="results-div"> 
      <div className="results-list">
        {Results.map(result => (
          <Result 
            gymName={result.gymName}
            gymAddress={result.gymAddress} 
            gymRating={result.gymRating}
          />
          ))}
      </div>
    </div>
  );
}

export default Results;
